import React from "react";
import "./Rules.css";

// Importera bilder från assets
import img1 from "../assets/bild1.jpg";
import img2 from "../assets/bild2.jpg";
import img3 from "../assets/bild3.jpg";
import img4 from "../assets/bild4.jpg";
import img5 from "../assets/bild5.jpg";
import img6 from "../assets/bild6.jpg";
import img7 from "../assets/bild7.jpg";
import img8 from "../assets/bild8.jpg";
import img9 from "../assets/bild9.jpg";
import img10 from "../assets/bild10.jpg";

const images = [img1, img2, img3, img4, img5, img6, img7, img8, img9, img10];

function Gallery() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <p>Se bilder från våra sjöar och evenemang.</p>

      <div
        className="rules-container"
        style={{
          display: "flex",
          flexWrap: "wrap",
          gap: "20px",
          justifyContent: "center",
        }}
      >
        {images.map((img, index) => (
          <div key={index} style={{ flex: "1 1 300px", minWidth: "300px" }}>
            <img
              src={img}
              alt={`Gallery ${index + 1}`}
              style={{ width: "100%", borderRadius: "8px", objectFit: "cover" }}
            />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Gallery;
